import styled from "styled-components";

const Main = (props) => {
  return <Container>Main</Container>;
};

const Container = styled.div`
  grid-area: main;
`;

const CommonCard = styled.div`
text-align: center;
overflow: hidden;
margin-bottom: 8px;
background-color: #fff;
border-radius: 5px;
position: relative;
border: none;
box-shadow: 0 0 0 1px rgb(0 0 0 / 15), 0 0 0 rgb(0 0 0 / 20);
`;

export default Main;
